import React, {useState, useEffect} from 'react'
import styles from './App.css'
function App(){

  const [data, setData] = useState([{}])

  useEffect(() =>{
    fetch("/members").then(
      res => res.json()
    ).then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  }, [])
  return(
    <div>
    <div className='parent_container'>
      <div className='main'>
      <input type='text'></input>
      <button className='submit'>Submit</button>
      </div>
      <div>
        <p>CyberBullying!!!</p>
      </div>
    </div>
  </div>
  )


}


export default App
